import React, { useState } from 'react';
import TodoList from './TodoList';

function App() {
  const [todos, setTodos] = useState([{id: 1, name: "abc", complete: true},{id: 1, name: "abc", complete: true}]);
  return (
    <>
      <TodoList todos={todos} />
      <input type="text" />
      <button> Add Tode</button>
      <button>Clear Completed</button>
      <div>0 left to do</div>
    </>
  );
}

export default App;
